import './CostItem.css';

function CostItem({ item }) {

    const { name, date, price } = item;

    return (
        <div className='container'>
            <div className='block'>
                <h1>{name}</h1>
                <p>{date}</p>
                <p>{price}</p>
            </div>
        </div>
    )
}

export default CostItem;
